#include <iostream>
using namespace std;

int main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int n;
    cin >> n;

    int x1, y1, x2, y2;
    cin >> x1 >> y1 >> x2 >> y2;

    // Calculate the Manhattan distance components
    int dx = abs(x2 - x1);
    int dy = abs(y2 - y1);

    // Determine the winner
    if ((dx + dy) % 2 == 1) {
        cout << "Caring Koala\n";
    } else {
        cout << "Red Panda\n";
    }

    return 0;
}
